<template>
  <input type="file" @change="changeHandle" accept=".xlsx" />
  <vue-office-excel
    :src="excel"
    style="height: calc(100vh - 150px)"
    @rendered="renderedHandler"
    @error="errorHandler"
  />
</template>

<script>
//引入VueOfficeExcel组件
import VueOfficeExcel from "@vue-office/excel";
//引入相关样式
import "@vue-office/excel/lib/index.css";
import { ref } from "vue";

export default {
  components: {
    VueOfficeExcel,
  },
  setup() {
    const xls = ref(
      "https://lichee-img.oss-cn-hangzhou.aliyuncs.com/csdn/wenjian/XLS%20%E5%B7%A5%E4%BD%9C%E8%A1%A8.xls"
    );
    const xlsx = ref(
      "https://lichee-img.oss-cn-hangzhou.aliyuncs.com/csdn/wenjian/XLSX%20%E5%B7%A5%E4%BD%9C%E8%A1%A8.xlsx"
    );

    console.log("會跨域", xls.value, xlsx.value);
    const excel = ref(
      `data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,`
    ); //文档地址

    // const excel = ref(xlsx.value);
    const renderedHandler = () => {
      console.log("渲染完成");
      console.log(excel.value);
    };
    const errorHandler = () => {
      console.log("渲染失败");
    };
    const changeHandle = (e) => {
      const file = e.target.files[0];
      const reader = new FileReader();
      reader.readAsDataURL(file);
      reader.onload = (e) => {
        excel.value = e.target.result;
      };
    };
    return {
      excel,
      renderedHandler,
      errorHandler,
      changeHandle,
    };
  },
};
</script>
